INSERT INTO `catalog_product_entity_text` VALUES (60,10,495,0,29,'B000JI2N0I'),(61,10,97,0,29,'Comfortable and fun to wear these clogs are the latest trend in fashion footwear. Wear them either at the beach, in your garden, at the mall or just about anywhere you would want to be comfortable.'),(62,10,492,0,29,'    * Made of EVA foam\r\n    * Heel strap keeps shoe on foot\r\n    * Non-marking, slip-resistant outsole\r\n    * Weigh just 6-10 ounces\r\n\r\n'),(63,10,104,0,29,'CN Clogs Beach/Garden Clog '),(64,10,495,0,30,'B000CP1M00'),(65,10,97,0,30,'The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. Solyte midsole material is lighter than standard EVA and SpEVA® combined with improved cushioning and durability. Impact Guidance System (I.G.S.®) uses linked componentry to encourage optimal gait while allowing for natural foot movement from heel strike to toe off. DuoMax® support system helps ensure that the shoe maintains proper support for the foot during the critical transition from heel strike to toe off. Space Trusstic® System creates a pocket between the Trusstic® System device and the midsole, allowing for greater midsole deformation and more efficient foot function. GEL® Cushioning System provides maximum rearfoot and forefoot shock attenuation. Wt. 12.6 oz.'),(66,10,495,0,32,'B000LJQVF8'),(67,10,97,0,32,'The Lucero pump from Nine West may just leave him at a loss for words. This flirty pump has a leather upper, a pretty almond-shaped toe with a slight V-cut vamp, leather linings, and a cushioned insole for long-wearing comfort. The stiletto heel radiates a subtle hint of sensuality, so sass up your jean and t-shirt look or nighttime attire with this hot pump and you\'ll be absolutely unforgettable.'),(68,10,492,0,32,'The perfect pump will suit any ensemble. Leather upper. 3-3/4 inch stacked heel. Man-made sole. Imported. '),(69,10,104,0,32,'Nine West Women\'s Lucero Pump '),(70,10,495,0,33,'B000NPOA1M'),(71,10,97,0,33,'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links. The contrasting embossed snakeskin panels attract interest, while the laid back lace-up style keeps things simple. And thanks to the one-year waterproof guarantee, you can trust these shoes to keep you in the game, even when conditions are less than perfect.'),(72,10,495,0,35,'Impatience'),(73,10,97,0,35,'# 6.1 oz. 100% preshrunk heavyweight cotton \r\n# Shoulder-to-shoulder taping\r\n# Double-needle sleeves and bottom hem'),(74,10,104,0,35,'Coalesce: Functioning On Impatience T-Shirt'),(75,10,495,0,36,'Ink Eater:'),(76,10,97,0,36,'We bought these with the intention of making shirts for our family reunion, only to come back the next day to find each and every one of them had been tagged by The Bear.  Oh well -- can\'t argue with art.  Now you can make your grandparents proud by wearing an original piece of graf work to YOUR family reunion!'),(77,10,104,0,36,'Ink Eater: Krylon Bombear Destroyed Tee'),(103,10,495,0,46,'750'),(104,10,494,0,46,'3.8 x 2.1 x 1 inches'),(105,10,97,0,46,'Olympus continues to innovate with the launch of the Stylus 750 digital camera, a technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom that tucks away into a streamlined metal, all-weather body design. The camera is distinguished by a number of premium features, including:\r\n\r\n    * An advanced combination of the mechanical CCD-shift Image Stabilization and Digital Image Stabilization work together to ensure the clearest pictures possible in any situation;\r\n    * A 5x optical zoom lens with a newly developed lens element to maintain a small compact size;\r\n    * A 2.5-inch LCD and Bright Capture Technology dramatically improve composition, capture and review of images in low-light situations;\r\n    * Olympus\' exclusive TruePic Turbo Image Processing engine is coupled with a 7.1-megapixel image sensor to produce crisp, high-quality p'),(106,10,492,0,46,'<ul>\r\n<ul class=\"disc\">\r\n\r\n<li>7.1-megapixel CCD captures enough detail for photo-quality 15 x 20-inch prints<br></li>\r\n<li>5x image-stabilized optical zoom; 2.5-inch LCD display<br></li>\r\n<li>Compact, all-weather body measures 3.8 x 2.1 x 0.96 inches<br></li>\r\n<li>Bright Capture technology; 27 selectable shooting modes; built-in Help guide<br></li>\r\n<li>Stores images on xD Picture Cards; powered by Li-Ion battery (battery and charger included)</li>\r\n</ul>'),(107,10,104,0,46,'Olympus, stylus, 750, 7MP, digital, camera, zoom'),(118,10,495,0,49,'B000KJ43SG'),(119,10,97,0,49,'Womens Premier Leather Single Layer Narrow Strap - NEW Colors Available - Womens Style - Genuine Top Grain Premier Leather - Rich Color Tones - Straps lined with 2000 lb test nylon - Guaranteed for the Life of the Sole - Non-slip sole - Note: Rainbow is in the process of unveiling a new toe post tag that is much smaller than the original tag.'),(120,10,492,0,49,'Womens Premier Leather Single Layer Narrow Strap - '),(121,10,104,0,49,'womens, sandal, leather, anashria, '),(122,10,495,0,51,'magotto'),(123,10,507,0,51,'Italy'),(124,10,509,0,51,'Microfiber'),(125,10,97,0,51,'The Magento ottoman will impress with its style while it delivers on quality. This piece of living room furniture is built to last with durable solid wood framing, generous padding and plush stain-resistant microfiber upholstery.'),(126,10,104,0,51,'Ottoman'),(127,10,495,0,52,'1112'),(128,10,507,0,52,'Italy'),(129,10,509,0,52,'Microfiber'),(130,10,97,0,52,'This Magento chair features a fun, futuristic design, with fluid curves and gentle angles that follow the shape of the body to enhance ultimate relaxation. It combines a hint