ir doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality. '),(368,10,531,0,143,''),(369,10,104,0,144,'2 Year Warranty - Parts and Labor'),(370,10,97,0,144,'2 Year Extended Warranty - Parts and Labor'),(371,10,506,0,144,'2 Year Extended Warranty - Parts and Labor'),(372,10,531,0,144,''),(373,10,104,0,145,''),(374,10,97,0,145,'Overclocker’s dream! Deliver more sophisticated solutions with the leading-edge technology of AMD Phenom™ 9000 Series processor. Built from the ground up for true quad-core performance, AMD Phenom 9000 Series processors incorporate a unified high-speed L3 cache and high-speed DDR2 memory. Speed through complex multitasking, critical business productivity, advanced visual design and modeling and visually stunning digital media and entertainment. Whether it\'s a single solution or an enterprise system, AMD Phenom processors have the power to perform.'),(375,10,531,0,145,''),(376,10,531,0,146,''),(377,10,500,0,147,'22\"'),(378,10,104,0,147,''),(379,10,97,0,147,'The wide, 16:10 format of SAMSUNG\'s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.'),(380,10,506,0,147,'The wide, 16:10 format of SAMSUNG\'s 226BW digital/Analog widescreen LCD monitor gives you plenty of room for all your computer applications and multiple images. DC 3000:1 contrast ratio creates crisp, easy-to-view images and gaming graphics, without ghosting or blurring. Complete with Microsoft® Vista® Premium certification and advanced dual interface for both analog digital video signals, the 226BW monitor is future-ready.'),(381,10,531,0,147,''),(382,10,104,0,148,''),(383,10,97,0,148,'Frustrated by staring at the hourglass icon as soon as you try to work on more than three programs at once, especially when you’re working with digital media? Increase your performance with the AMD Athlon™ 64 X2 dual core processor. Work or play with multiple programs without any stalling or waiting. Dual-core technology is like having two processors, and two working together is better and faster than one working alone. Do more in less time with the AMD Athlon 64 X2 dual-core processor.'),(384,10,506,0,148,'AMD Athlon 64 X2 3800+ Processor ADO3800IAA5CZ - 2.0GHz, 2 x 512KB Cache, 1000MHz (2000 MT/s) FSB, Windsor, Dual Core, OEM, Socket AM2, Processor'),(385,10,531,0,148,''),(391,10,499,0,150,'500 GB'),(392,10,531,0,150,''),(393,10,506,0,151,'Intel® Core™2 Duo processor is the new brand name for our next-generation energy-efficient performance desktop and mobile processors.'),(394,10,531,0,151,''),(395,10,500,0,152,'24\"'),(396,10,104,0,152,''),(397,10,97,0,152,'With ultrafine 10,000:1 contrast and wide 170° viewing angles, this 24\" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device.\r\n\r\nProduct Features:\r\n    * Ultrafast 5 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 400 cd/m² brightness\r\n    * 1920 x 1200 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n'),(398,10,506,0,152,'5 ms response time; 10,000:1 contrast ratio; 400 cd/m² brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs'),(399,10,506,0,153,'Intel Core 2 Extreme QX9775 Processor BX80574QX9775 - 45nm, 3.20GHz, 12MB Cache, 1600MHz FSB, Yorkfield XE, Quad-Core, Retail, Socket 771, Processor'),(404,10,499,0,155,'5400 rpm'),(405,10,104,0,155,''),(406,10,500,0,156,'19\"'),(407,10,506,0,156,'2 ms response time; 10,000:1 contrast ratio; 300 cd/m² brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs'),(408,10,531,0,156,''),(409,10,500,0,157,'30\"'),(410,10,104,0,157,''),(411,10,97,0,157,'    * Digital (DVI), USB 2.0 and FireWire 400 inputs\r\n    * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture\r\n    * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print\r\n    * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter\r\n    * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices\r\n    * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt\r\n    * Antiglare, hard-coat screen treatment\r\n    * Wall-mountable with optional mounting kit (not included)\r\n    * ENERGY STAR compliance assures a high standard of energy efficiency\r\n'),(412,10,506,0,157,'Computer games, digital photo editing and graphic applications will astound you on this huge 30\" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.'),(414,10,97,0,159,'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard. And we know you’re going to love it. This newest addition to the world’s best selling line of ergonomic keyboards features a natural wrist alignment that will make your day! Just one touch allows you to perform a wealth of common but important tasks such as opening documents and replying to e-mail. The Microsoft Natural Model 4000 ergonomic keyboard also features an improved number pad with easy-to-reach symbols such left and right, equal sign and back space placed just above the number pad. Easy-access to the Internet. Multimedia keys. Lockable F keys and much more (see complete list of additional features below). Don’t you think it’s time to go natural? Microsoft’s Natural Ergonomic Model 4000 Keyboard. Available right here, for the best price!'),(415,10,506,0,159,'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard.'),(416,10,531,0,159,''),(417,10,104,0,160,''),(418,10,97,0,160,'Our most advanced trackball yet: a comfortable, cordless, finger-operated trackball that works where you need it. Save space and eliminate desktop clutter. Take advantage of extra buttons that help you navigate around Windows and the web more easily. And with Logitech\'s patented optical technology, you get virtually maintenance-free precision and smooth tracking.'),(419,10,506,0,160,'Our most advanced trackball yet. It\'s comfortable, cordless, finger-operated and works where you need it. Save space and eliminate desktop clutter.'),(420,10,531,0,160,''),(421,10,104,0,161,''),(422,10,97,0,161,'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered. Stylishly sleek with its elegant charging base and backlit controls, the diNovo Edge makes a bold statement.\r\n\r\nAn ideal partner for any high-end computer, the ultra-slim Logitech diNovo Edge delivers the ultimate in feel and response. The revolutionary TouchDisc with hyper-speed scrolling and pixel-perfect control makes trackpads obsolete. A slim recharging base doubles as a keyboard stand. Work longer thanks to the longer-lasting Li-Ion batteries, and more securely via Bluetooth wireless technology. Combine it with the world\'s most advanced mouse, the Logitech MX Revolution, for a premium desktop experience!'),(423,10,506,0,161,'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered.'),(424,10,531,0,161,''),(425,10,104,0,162,''),(426,10,97,0,162,'Experience smoother tracking and wireless freedom. Navigate with enhanced precision with this ergonomic High Definition Optical mouse. Easily enlarge and edit detail with the new Magnifier and enjoy more than six months of battery life. '),(427,10,506,0,162,'Experience smoother tracking and wireless freedom. Navigate with enhanced precision with this ergonomic High Definition Optical mouse.'),(428,10,531,0,162,''),(438,10,104,0,165,''),(439,10,506,0,165,'test description'),(440,10,97,0,165,'test description'),(441,10,531,0,165,''),(442,10,495,0,166,'HTC Touch Diamond'),(443,10,104,0,166,''),(444,10,506,0,166,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.'),(445,10,97,0,166,'<p class=\"h3\">Paragraph text</p>\r\n<p>Re-defining the perception of advanced mobile phones&hellip; the HTC Touch Diamond&trade; signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design. Featuring a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use. With HTC&rsquo;s vibrant touch-responsive user interface, TouchFLO&trade; 3D, and ultra-fast HSDPA internet connectivity&hellip; the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection. Your contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends&rsquo; and family&rsquo;s faces are brought to life for you to interact, play and launch at your fingertips. A 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit. Style and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.</p>\r\n<p class=\"h3\">Unordered list</p>\r\n<ul class=\"list-style-type:disc\">\r\n<li>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</li>\r\n<li>Nunc at arcu sit amet augue molestie lacinia nec at magna.</li>\r\n<li>Nam pharetra, lacus ac molestie ultrices.</li>\r\n<li>Maecenas quis risus at neque ultrices vehicula nec in est.</li>\r\n<li>Nullam leo velit, mattis ut arcu semper, pulvinar aliquet urna.</li>\r\n</ul>\r\n<p class=\"h3\">Ordered list</p>\r\n<ol class=\"list-style-type:number\">\r\n<li>Donec purus orci, venenatis vitae ultrices a.</li>\r\n<li>Aenean sollicitudin leo tempus lectus interdum auctor.</li>\r\n<li>Etiam tincidunt turpis eget sodales laoreet.</li>\r\n<li>Fusce volutpat nibh bibendum porttitor rutrum.</li>\r\n<li>Vivamus vel justo non mi vehicula venenatis.</li>\r\n</ol>\r\n<p>Suspendisse ante enim, tincidunt et tincidunt vel, ultrices in augue. Praesent at nulla felis. Suspendisse urna velit, volutpat vitae tincidunt eget, pellentesque quis lectus. Aellus sed tellus malesuada, dictum arcu sit amet, elementum mi. Integer facilisis, lectus cursus luctus porttitor, arcu leo imperdiet leo, non fringilla elit ante non quam. Duis luctus orci placerat elementum auctor. Proin sed neque fermentum, aliquet nibh id, pellentesque lacus. Nam ultricies interdum venenatis.</p>\r\n<p class=\"img-detail\"><a href=\"#\"><img class=\"fluid\" src=\"{{media url=\"wysiwyg/img-detail.png\"}}\" alt=\"\" /></a></p>'),(446,10,492,0,166,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.\r\n\r\nFeaturing a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use.\r\n\r\nWith HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.'),(447,10,494,0,166,'102 mm (L) X 51 mm (W) X 11.35 mm (T)'),(448,10,496,0,166,''),(449,10,531,0,166,''),(451,10,531,0,94,''),(452,10,531,0,30,''),(453,10,531,0,95,''),(454,10,531,0,96,''),(455,10,531,0,97,''),(457,10,531,0,35,''),(458,10,531,0,117,''),(459,10,531,0,32,''),(460,10,531,0,110,''),(461,10,531,0,109,''),(462,10,531,0,111,''),(463,10,531,0,36,''),(465,10,531,0,38,''),(466,10,531,0,128,''),(467,10,531,0,130,''),(468,10,531,0,127,''),(469,10,531,0,129,''),(470,10,531,0,131,''),(471,10,531,0,37,''),(472,10,531,0,124,''),(473,10,531,0,125,''),(474,10,531,0,122,''),(475,10,531,0,121,''),(476,10,531,0,29,''),(477,10,531,0,84,''),(478,10,531,0,86,''),(479,10,531,0,85,''),(480,10,531,0,87,''),(481,10,531,0,88,''),(482,10,531,0,89,''),(483,10,531,0,90,''),(484,10,531,0,91,''),(485,10,531,0,92,''),(486,10,531,0,100,''),(487,10,531,0,101,''),(488,10,531,0,102,''),(489,10,531,0,99,''),(490,10,531,0,34,''),(491,10,531,0,104,''),(492,10,531,0,31,''),(493,10,531,0,105,''),(494,10,531,0,106,''),(495,10,531,0,107,''),(496,10,531,0,113,''),(497,10,531,0,114,''),(498,10,531,0,115,''),(499,10,531,0,33,''),(500,10,531,0,7