INSERT INTO `catalog_product_flat_1` VALUES (29,40,'simple',NULL,25,'Blue',NULL,NULL,NULL,NULL,1.0000,NULL,NULL,NULL,'2007-08-24 11:53:19',NULL,NULL,'','Comfortable and fun to wear these clogs are the latest trend in fashion footwear. Wear them either at the beach, in your garden, at the mall or just about anywhere you would want to be comfortable.',NULL,NULL,NULL,NULL,35,'Womens',0,NULL,NULL,0,'/c/n/cn-clogs-beach-garden-clog-2.jpg',NULL,'    * Made of EVA foam\r\n    * Heel strap keeps shoe on foot\r\n    * Non-marking, slip-resistant outsole\r\n    * Weigh just 6-10 ounces\r\n\r\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'CN Clogs Beach/Garden Clog','CN Clogs Beach/Garden Clog ','CN Clogs Beach/Garden Clog',15.9900,'B000JI2N0I',NULL,NULL,NULL,'CN Clogs Beach/Garden Clog',NULL,NULL,NULL,15.9900,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,46,'3',97,'Sandal','Comfortable and fun to wear these clogs are the latest trend in fashion footwear','cn_3',NULL,'/c/n/cn-clogs-beach-garden-clog-3.jpg',NULL,NULL,NULL,NULL,2,'/c/n/cn-clogs-beach-garden-clog-4.jpg',NULL,'2008-08-07 17:51:34','cn-clogs-beach-garden-clog-3','cn-clogs-beach-garden-clog-3.html',1,1.0000,NULL),(30,40,'simple',NULL,61,'Gray',NULL,NULL,NULL,NULL,29.9900,NULL,NULL,NULL,'2007-08-24 12:00:49',NULL,NULL,'','The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. Solyte midsole material is lighter than standard EVA and SpEVA® combined with improved cushioning and durability. Impact Guidance System (I.G.S.®) uses linked componentry to encourage optimal gait while allowing for natural foot movement from heel strike to toe off. DuoMax® support system helps ensure that the shoe maintains proper support for the foot during the critical transition from heel strike to toe off. Space Trusstic® System creates a pocket between the Trusstic® System device and the midsole, allowing for greater midsole deformation and more efficient foot function. GEL® Cushioning System provides maximum rearfoot and forefoot shock attenuation. Wt. 12.6 oz.',NULL,NULL,NULL,NULL,36,'Mens',0,NULL,NULL,0,'no_selection',NULL,'# I.G.S.?: Allows for natural foot movement from heel strike to toe-off\r\n# DuoMax? Support System: Maintains proper support for the foot during the critical transition from heel strike to toe-off\r\n# Space Trusstic System?: Allows for greater midsole deformation and more efficient foot function\r\n# GEL? Cushioning System: Provides maximum rearfoot/forefoot shock attenuation\r\n# Biomorphic Fit Upper: Provides enhanced upper fit and comfort while limiting irritation',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ASICS® Men\'s GEL-Kayano® XII','ASICS® Men\'s GEL-Kayano® XII ','ASICS® Men\'s GEL-Kayano® XII',134.9900,'B000CP1M00',NULL,NULL,NULL,'ASICS® Men\'s GEL-Kayano® XII',NULL,NULL,NULL,134.9900,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,41,'8',49,'Running','The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. ','asc_8',NULL,'no_selection',NULL,NULL,NULL,NULL,2,'no_selection',NULL,'2008-07-31 10:23:28','asics-men-s-gel-kayano-xii-8','asics-men-s-gel-kayano-xii-8.html',1,3.0000,NULL),(31,40,'simple',NULL,26,'Red',NULL,NULL,NULL,NULL,29.9900,NULL,NULL,NULL,'2007-08-24 12:05:50',NULL,NULL,'','Nothing will turn his head faster than you wearing the sexy Pryme pump from Steven by Steve Madden. This daring pump has a pretty patent leather upper with light shirring, a double stitch detail surrounding the collar, and a vampy almond shaped toe. It also features smooth linings, a fully cushioned insole, a sexy covered stiletto heel, and a lightly textured dress leather outsole. Any way you wear the Pryme, you\'re certain to catch a lot of attention.',NULL,NULL,NULL,NULL,35,'Womens',0,NULL,NULL,0,'/s/t/steven-by-steve-madden-pryme-pump-2.jpg',NULL,'A prime example of chic style. Patent leather upper. Round toe. 3-1/2 inch covered heel. Flex leather sole. Imported. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Steven by Steve Madden Pryme Pump','Steven by Steve Madden Pryme Pump','Steven by Steve Madden Pryme Pump',69.9900,'B000NOGIKY',NULL,NULL,NULL,'Steven by Steve Madden Pryme Pump',NULL,NULL,NULL,69.9900,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,45,'4',51,'High Heels','Nothing will turn his head faster than you wearing the sexy Pryme pump from Steven by Steve Madden. This daring pump has a pretty patent leather upper with light shirring, a double stitch detail surrounding the collar, and a vampy almond shaped toe','steve_4',NULL,'/s/t/steven-by-steve-madden-pryme-pump-3.jpg',NULL,NULL,NULL,NULL,2,'/s/t/steven-by-steve-madden-pryme-pump-4.jpg',NULL,'2008-08-07 18:02:40','steven-by-steve-madden-pryme-pump-4','steven-by-steve-madden-pryme-pump-4.html',1,2.0000,NULL),(32,40,'simple',NULL,26,'Red',NULL,NULL,NULL,NULL,29.9900,NULL,NULL,NULL,'2007-08-24 12:12:54',NULL,NULL,'','The Lucero pump from Nine West may just leave him at a loss for words. This flirty pump has a leather upper, a pretty almond-shaped toe with a slight V-cut vamp, leather linings, and a cushioned insole for long-wearing comfort. The stiletto heel radiates a subtle hint of sensuality, so sass up your jean and t-shirt look or nighttime attire with this hot pump and you\'ll be absolutely unforgettable.',NULL,NULL,NULL,NULL,35,'Womens',0,NULL,NULL,0,'no_selection',NULL,'The perfect pump will suit any ensemble. Leather upper. 3-3/4 inch stacked heel. Man-made sole. Imported. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Nine West Women\'s Lucero Pump','Nine West Women\'s Lucero Pump ','Nine West Women\'s Lucero Pump',89.9900,'B000LJQVF8',NULL,NULL,NULL,'Nine West 