rging base doubles as a keyboard stand. Work longer thanks to the longer-lasting Li-Ion batteries, and more securely via Bluetooth wireless technology. Combine it with the world\'s most advanced mouse, the Logitech MX Revolution, for a premium desktop experience!',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,'/l/o/logitech-dinovo-edge-keyboard.jpg',NULL,NULL,NULL,NULL,NULL,NULL,121,'Logitech',NULL,NULL,NULL,NULL,NULL,'','','',NULL,NULL,NULL,NULL,NULL,'Logitech diNovo Edge Keyboard',NULL,NULL,NULL,239.9900,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered.','logidinovo',NULL,'/l/o/logitech-dinovo-edge-keyboard.jpg',NULL,NULL,NULL,NULL,0,'/l/o/logitech-dinovo-edge-keyboard.jpg',NULL,'2008-08-08 08:31:22','logitech-dinovo-edge-keyboard','logitech-dinovo-edge-keyboard.html',4,1.0000,NULL),(162,9,'simple',NULL,24,'Black',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2008-07-24 18:25:11',NULL,NULL,'','Experience smoother tracking and wireless freedom. Navigate with enhanced precision with this ergonomic High Definition Optical mouse. Easily enlarge and edit detail with the new Magnifier and enjoy more than six months of battery life. ',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,'/m/i/microsoft-wireless-optical-mouse-5000.jpg',NULL,NULL,NULL,NULL,NULL,NULL,120,'Microsoft',NULL,NULL,NULL,NULL,NULL,'','','',NULL,NULL,NULL,NULL,NULL,'Microsoft Wireless Optical Mouse 5000',NULL,NULL,NULL,59.9900,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Experience smoother tracking and wireless freedom. Navigate with enhanced precision with this ergonomic High Definition Optical mouse.','micronmouse5000',NULL,'/m/i/microsoft-wireless-optical-mouse-5000.jpg',NULL,NULL,NULL,NULL,1,'/m/i/microsoft-wireless-optical-mouse-5000.jpg',NULL,'2008-08-08 08:31:01','microsoft-wireless-optical-mouse-5000','microsoft-wireless-optical-mouse-5001.html',4,1.0000,NULL),(165,39,'bundle',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2008-07-24 18:40:27',NULL,NULL,'','test description',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'/m/y/my-computer.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','',NULL,NULL,NULL,NULL,NULL,'My Computer',NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,'test description','mycomputer',1,'/m/y/my-computer.jpg',NULL,'2008-07-30 00:00:00',75.0000,NULL,0,'/m/y/my-computer.jpg',NULL,'2008-07-31 09:19:40','my-computer','my-computer.html',4,10.0000,1),(166,38,'simple','',24,'Black',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2008-07-24 19:22:13',NULL,NULL,'','Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.\r\n\r\nFeaturing a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use.\r\n\r\nWith HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.','102 mm (L) X 51 mm (W) X 11.35 mm (T)',NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,'/h/t/htc-touch-diamond.jpg',NULL,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.\r\n\r\nFeaturing a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use.\r\n\r\nWith HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.',NULL,NULL,NULL,NULL,122,'HTC',NULL,NULL,NULL,NULL,NULL,'','','',NULL,'HTC Touch Diamond',NULL,NULL,NULL,'HTC Touch Diamond',NULL,NULL,NULL,750.0000,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech 