INSERT INTO `cms_page` VALUES (1,'404 Not Found 1','two_columns_right','Page keywords','Page description','no-route','','<div class=\"page-head-alt\"><h3>Whoops, our bad...</h3></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<br/>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1);\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br/><a href=\"{{store url=\"\"}}\">Store Home</a><br/><a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl><br/>\r\n<p><img src=\"{{skin url=\'images/media/404_callout1.jpg\'}}\" style=\"margin-right:15px;\"/><img src=\"{{skin url=\'images/media/404_callout2.jpg\'}}\" /></p>','2007-06-20 11:38:32','2007-08-26 12:11:13',1,0,NULL,NULL,'',NULL,NULL,NULL),(2,'Home page','two_columns_right','','','home','','<div class=\"col-left side-col\">\r\n<p class=\"home-callout\">\r\n<a href=\"{{store direct_url=\"apparel/shoes/womens/anashria-womens-premier-leather-sandal.html\"}}\"><img src=\"{{skin url=\'images/ph_callout_left_top.gif\'}}\" border=\"0\" /></a>\r\n</p>\r\n<p class=\"home-callout\">\r\n<img src=\"{{skin url=\'images/ph_callout_left_rebel.jpg\'}}\" border=\"0\" />\r\n</p>\r\n{{block type=\"tag/popular\" template=\"tag/popular.phtml\"}}\r\n</div>\r\n<div class=\"home-spot\">\r\n<p class=\"home-callout\">\r\n<img src=\"{{skin url=\'images/home_main_callout.jpg\'}}\" border=\"0\" width=\"470\" />\r\n</p>\r\n<p class=\"home-callout\">\r\n<img src=\"{{skin url=\'ima