INSERT INTO `review_detail` VALUES (1,1,1,'I love this shirt!','This shirts if really great. Especially with the spinal diagram, finally I can see myself for who I really am! ','Sandra Doe',1),(3,3,1,'Cute, but see through','Cute design, but material is too thin.','Natashenka',1),(4,4,1,'chics dig ribs','Ever since buying this shirt chics cant take their hands off me. I don\'t know what it is it must be sprayed with axe - the seductive body spray for men. I\'m the last one to believe commercials but I tell you you won\'t regret buying this shirt. I ordered it n every color.','udini',1),(6,6,1,'It\'s a pitty they don\'t have large sizes','You wont believe it, my show size is 13 so it\'s impossible for me to get a new pa','Seba\'s',1),(22,22,1,'Love it!!! get it!!!','You got to have one of these they come in green','yochan',1),(23,23,1,'Extremely Comfortable!!!','i love this T-shirt\r\nthe quality is nice\r\nand it\'s very soft without tag\r\n\r\ni bought the white one\r\nit can be see through just like other custom\'s review.\r\n\r\nalso i think their size small is a little bigger than other brand\r\nbut it\'s not a big deal though! ','Robin',1),(24,24,1,'excellent','The T-shirt is a very good one. its comfortable and easy to wash, doesn\'t even soften the cloth when washed daily. i love it and good stuff','A Review',1),(25,25,1,'Perfect Cotton Feel','My friend really liked the Tee shirt.he did\'nt think that I would be able to get it in his size but I was able to.I really made my friends day when I told him that I was able to find the tee shirt in the size he wanted.','Adam',1),(26,26,1,'Great, affordable product','These tee shirts are generously cut, hold their color, stand up to repeated washings and are very comfortable. In addition, they are comfortable, extremely affordable and maintain their shape. I highly recommend them.','Patrick',1),(27,27,1,' Well made, affordable. . .you can\'t go wrong!','I am very hard on my t-shirts, and therefore, I need the best quality t-shirt on the market. I\'ve tried them all (except Hanes).  Durable, strong, and surprisingly flattering to those of us lugging around a spare tire, if you get my drift.','Mike',1),(28,28,1,'Inexpensive and very light weight clog','This clog was inexpensive compared to crocs, but I found it did not fit my foot very well. It is, however, very light weight and would otherwise be comfortable. It is also not very attractive. I would not wear this one anywhere but my own yard for gardening, etc.','Loren',1),(29,29,1,' Beach Clogs,','I received these today in the mail and am pleased with the way these feel on my feet,they are so comfortable and so easy to slide on.','Laurie',1),(30,30,1,'Love the look and was comfy for heels!','Would give them 5 stars if not for the toe cleavage issue. Loved them enough to keep them though. Very cute!','Shoe Lover',1),(31,31,1,'Good, Sexy Shoe','These shoes are beautiful, the bright ruby red color complimented by outfit nicely. It did take some breaking in but after which they were as comfortable as pumps can get.','Shoes!!!',1),(32,32,1,'Classic and Cute','This shoe is comfortable and the way the front of the shoe is cut makes it a little more interesting.....','Vanessa',1),(33,33,1,' lite golf shoe','nice shoe. A little tight in the width','Tippy',1),(34,34,1,'Comfortable, good-looking','This is a sharp-looking shoe that is very comfortable for walking and provides a good alternative to the traditional, boring \"golf shoe.\"\r\n','Kathryn',1),(35,35,1,'womens golf shoes','These shoes are my first pair of golf shoes.I have bad feet and wear orthotics so I really wanted a pair of shoes that would feel great on my feet. These are really nice and are a great price for this brand.','Moqilka',1),(36,36,1,' Great Purchase. Best value and very comfortable,','I purchased a pair and have been using it everyday from the past six months. The shoes are very comfortable and look very professional. Love them.','Arun',1),(37,37,1,'Top leather scuffed on first wear','The shoes look and wear great. However, the leather is pretty weak. I think I must have kicked a table leg or something on my frist outing in them. Now the tip of my left shoe has a quarter-size scuff on it. I will have to try to cover it up by oiling it. Obviously I don\'t think this pair will last long at all.','Lian',1),(45,45,1,'great, comfy flip flops!','Very comfortable flip flops! I wear a size 10-11 and the \"extra-large\" was too small. Most stores don\'t carry the 10 or 11 (beyond extra-large) but I was able to find them on Amazon. Don\'t give up if you need a bigger size than the extra-large!','Erika',1),(46,46,1,'These are the best sandals!','They were delivered really quickly and are just what I was expecting. The are great quality and so comfortable!','Jenna',1),(47,47,1,'I love this Ottoman','Best Ottoman ever!!!!','Terry Ferguson',1),(51,51,1,'Good Camera','    	\r\n77 of 82 people found the following review helpful:\r\nGood Camera, October 11, 2006\r\nBy 	Steve (FL) - See all my reviews\r\nGot it yesterday. In green. Actually it\'s a shiney yellowish-green. Nice feel. Fits well in shirt pocket. Very light; particullarly compared to my Pentax Optio 550. Good, nice size LCD. Easy to use yet with nice availability of choices for customization. Well written manual (you can find online thru google) and onboard help menu. Photos come out fairly nice. Tried indoors in low light with several scene settings, outdoors, macro, and supermacro. Colors look true, fairly sharp without noticable artifact. Used in South Florida morning daylight outside without any trouble with LCD viewing (camera has no classic viewfinder). Have read reviews of washout in bright sun: have not tried that yet. Overall, I\'m happy with the camera thus far. ','Jenella',1),(52,52,1,'Great inexpensive Couch','I love this couch...  extremely comfortable and easy to clean\r\n','Toish',1),(60,60,0,'I wear these as I walk down the Boardwalk','Sexy shoes that always draw attention to my legs...  ','Fransisco',1),(63,63,1,'These look great','I was the hottest drag model at the show','Johnny',NULL),(67,67,1,'Top of the top','I\'ve been wearing these shoes since 1912 and believe me, they\'re hot !','Didier',NULL),(70,70,1,'This ist great - Love the style','I`ve been looking for such a couch for months now I\'ve found it!','JBrunner',1),(71,71,1,'Looks Good','Looks good and nice. Highly recommended ;)','devx',NULL),(72,72,1,'Greattt','Very good product !','Moimeme',NULL),(73,73,1,'Good shoes','great look, solid design','Terry',NULL),(75,75,1,'very cool','I love these','ilja',NULL),(78,78,1,'Mega shoes','I like it ...','Tester',1),(79,79,1,'Increased my profit margins by 15%','These shoes are great....I was in so much demand with my usal tricks...I could put my prices up by 15%... These shoes will definitely work wonders on your  Supply and Demand curve on your local turf :)','Lady of the night',NULL),(82,82,1,'Love the shirt and print - but a bit too pricey','I\'m a heavy spender of t-shirts and love the quality and prints offered, but the combinded price handling, shipping and item price is very high compared to desigener t-shirts','Dynamo',NULL),(83,83,NULL,'The best!','Wow!  Amazing shoes if I ever saw ones:  great for those cold, dreary winter months, keep your feet warm and dry!','Jane Austin',NULL),(85,85,1,'Look good but wow are they expensive for what they are!','These sandalls look good, very photogenenic, but would anybody seriously pay this price for them?','Pete',NULL),(96,96,1,'Amazing','Holy-Moly.','Crazy Pants',NULL),(97,97,NULL,'her the summary','that\'s my best review ;-)','lagad',1),(100,100,1,'Word ottoman ever','I know because I am king of the Ottoman Empire','Xerses',1),(105,105,1,'great website','great website','smerphy',1),(114,114,1,'fdsfsd','fsd','dfsa',NULL),(115,115,1,'df','sdf sà','Kieu',3),(116,116,1,'sd à','fsd sdf','Kieu',3),(121,121,1,'test','test','test',NULL),(122,122,1,'dsga',' adfg fsdgsd','dsfa',NULL),(123,123,1,'dfg ','dfh sadfgdf','dfh',NULL),(124,124,1,'22\" Syncmaster LCD Monitor','22\" Syncmaster LCD Monitor','jacky',NULL),(125,125,1,'24\" Widescreen Flat-Panel LCD Monitor','24\" Widescreen Flat-Panel LCD Monitor','linda',NULL),(126,126,1,'test','test','test',NULL);
